import React, { Component } from 'react'
import './App.css';

export default class Home extends Component {
    render() {
        return (
            <div>
                <h1>Home</h1>
                <p>This is home.</p>
                <img src="/NBALogo.png" alt="NBA" />
            </div>
        )
    }
}
